("276","&lt;p&gt;The coordinate of an object is given as a function of time by &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;=&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;msup&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;msup&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;, where x is in meters and t is in seconds. Its average acceleration over the interval from t = 0 to t = 2 s is:&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","3","1"),
("277","&lt;p&gt;An object starts from rest at the origin and moves along the x axis with a constant acceleration of 4 meter per second square&amp;nbsp;. Its average velocity as it goes from x = 2m to x = 8m is:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;2m/s&lt;/p&gt;","&lt;p&gt;3m/s&lt;/p&gt;","&lt;p&gt;5m/s&lt;/p&gt;","&lt;p&gt;6m/s&lt;/p&gt;","4","1"),
("278","&lt;p&gt;The position y of a particle moving along the y axis depends on the time t according to the&lt;/p&gt;&lt;p&gt;Equation &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mi&gt;y&lt;/mi&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;=&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mi&gt;a&lt;/mi&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mi&gt;b&lt;/mi&gt;&lt;msup&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;. The dimensions of the quantities a and b are respectively:&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mfrac&gt;&lt;msup&gt;&lt;mi&gt;L&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;mi&gt;T&lt;/mi&gt;&lt;/mfrac&gt;&lt;mo&gt;,&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mfrac&gt;&lt;msup&gt;&lt;mi&gt;L&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msup&gt;&lt;msup&gt;&lt;mi&gt;T&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/mfrac&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mfrac&gt;&lt;mi&gt;L&lt;/mi&gt;&lt;msup&gt;&lt;mi&gt;T&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/mfrac&gt;&lt;mo&gt;,&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mfrac&gt;&lt;msup&gt;&lt;mi&gt;L&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;mi&gt;T&lt;/mi&gt;&lt;/mfrac&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mfrac&gt;&lt;mi&gt;L&lt;/mi&gt;&lt;mi&gt;T&lt;/mi&gt;&lt;/mfrac&gt;&lt;mo&gt;,&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mfrac&gt;&lt;mi&gt;L&lt;/mi&gt;&lt;msup&gt;&lt;mi&gt;T&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/mfrac&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mfrac&gt;&lt;msup&gt;&lt;mi&gt;T&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msup&gt;&lt;mi&gt;T&lt;/mi&gt;&lt;/mfrac&gt;&lt;mo&gt;,&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mfrac&gt;&lt;msup&gt;&lt;mi&gt;T&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;mi&gt;L&lt;/mi&gt;&lt;/mfrac&gt;&lt;/math&gt;&lt;/p&gt;","3","1"),
("279","&lt;p&gt;Over a short interval near time t = 0 the coordinate of an automobile in meters is given by&lt;/p&gt;&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mfenced&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;/mfenced&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;=&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mn&gt;27&lt;/mn&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;msup&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;, &amp;nbsp;where t is in seconds. At the end of 1.0 s the acceleration of the auto is:&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;27&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;24&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","4","1"),
("280","&lt;p&gt;A particle moves along the x axis according to the equation &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;=&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mn&gt;6&lt;/mn&gt;&lt;msup&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;, where x is in meters and&lt;/p&gt;&lt;p&gt;t is in seconds. Therefore:&lt;/p&gt;","1","","2","&lt;p&gt;. the acceleration of the particle is&amp;nbsp;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;6&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;t cannot be negative&lt;/p&gt;","&lt;p&gt;the particle follows a parabolic path&lt;/p&gt;","&lt;p&gt;none of the above&lt;/p&gt;","4","1"),
("281","&lt;p&gt;. At time t = 0 a car has a velocity of 16 m/s. It slows down with an acceleration given by&lt;/p&gt;&lt;p&gt;&amp;minus;0.50t, in &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&amp;nbsp;for t in seconds. It stops at t =&lt;/p&gt;","1","","2","&lt;p&gt;64 s&lt;/p&gt;","&lt;p&gt;32 s&lt;/p&gt;","&lt;p&gt;16 s&lt;/p&gt;","&lt;p&gt;8.0&lt;b&gt; &lt;/b&gt;s&lt;/p&gt;","4","1"),
("282","&lt;p&gt;. At time t = 0 a car has a velocity of 16 m/s. It slows down with an acceleration given by&lt;/p&gt;&lt;p&gt;&amp;minus;0.50t, in meter per second square&amp;nbsp;for t in seconds. At the end of 4.0 s it has traveled:&lt;/p&gt;","1","","2","&lt;p&gt;0&lt;/p&gt;","&lt;p&gt;12 m&lt;/p&gt;","&lt;p&gt;14 m&lt;/p&gt;","&lt;p&gt;59 m&lt;/p&gt;","4","1"),
("283","&lt;p&gt;At time t = 0 a car has a velocity of 16 m/s. It slows down with an acceleration given by&lt;/p&gt;&lt;p&gt;&amp;minus;0.50t, in &amp;nbsp;meter per second square&amp;nbsp;for t in seconds. By the time it stops it has traveled:&lt;/p&gt;","1","","2","&lt;p&gt;15 m&lt;/p&gt;","&lt;p&gt;31 m&lt;/p&gt;","&lt;p&gt;62 m&lt;/p&gt;","&lt;p&gt;85 m&lt;/p&gt;","4","1"),
("284","&lt;p&gt;Starting at time t = 0, an object moves along a straight line with velocity in m/s given by&amp;nbsp;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mi&gt;v&lt;/mi&gt;&lt;mfenced&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;/mfenced&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;=&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mn&gt;98&lt;/mn&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;msup&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;,&amp;nbsp;where t is in seconds. When it momentarily stops its acceleration is:&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&amp;nbsp;&amp;minus;4.0 meter per second square&lt;/p&gt;","&lt;p&gt;&amp;minus;9.8 meter per second square&lt;/p&gt;","&lt;p&gt;&amp;minus;28&lt;b&gt; &lt;/b&gt;meter per second square&lt;/p&gt;","4","1"),
("285","&lt;p&gt;Starting at time t = 0, an object moves along a straight line. Its coordinate in meters is given by&amp;nbsp;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mfenced&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;/mfenced&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;=&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mn&gt;75&lt;/mn&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;msup&gt;&lt;mi&gt;t&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;,&amp;nbsp;where t is in seconds. When it momentarily stops its acceleration is:&lt;/p&gt;","1","","2","&lt;p&gt;0&lt;/p&gt;","&lt;p&gt;&amp;minus;73 meter per second square&lt;/p&gt;","&lt;p&gt;&amp;minus;30&lt;b&gt; &lt;/b&gt;meter per second square&lt;/p&gt;","&lt;p&gt;&amp;minus;9.8 meter per second square&lt;/p&gt;","3","1"),
("286","&lt;p&gt;A car, initially at rest, travels 20 m in 4 s along a straight line with constant acceleration. The&lt;/p&gt;&lt;p&gt;acceleration of the car is:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;5&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;9&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","2","1"),
("287","&lt;p&gt;&amp;nbsp;A racing car traveling with constant acceleration increases its speed from 10m/s to 50m/s over a distance of 60 m. How long does this take?&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;2.0 s&amp;nbsp;&lt;/p&gt;","&lt;p&gt;4.0 s&lt;/p&gt;","&lt;p&gt;5.0 s&lt;/p&gt;","&lt;p&gt;8.0 s&lt;/p&gt;","1","1"),
("288","&lt;p&gt;A car starts from rest and goes down a slope with a constant acceleration of &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;5&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;. After&lt;/p&gt;&lt;p&gt;5 s the car reaches the bottom of the hill. Its speed at the bottom of the hill, in meters per&lt;/p&gt;&lt;p&gt;second, is:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;1&lt;/p&gt;","&lt;p&gt;12.5&lt;/p&gt;","&lt;p&gt;25&lt;/p&gt;","&lt;p&gt;50&lt;/p&gt;","3","1"),
("289","&lt;p&gt;. A car moving with an initial velocity of 25 m/s north has a constant acceleration of&amp;nbsp;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;&lt;p&gt;south. After 6 seconds its velocity will be:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;7 m/s north&lt;/p&gt;","&lt;p&gt;7 m/s south&lt;/p&gt;","&lt;p&gt;43 m/s north&lt;/p&gt;","&lt;p&gt;20 m/s north&lt;/p&gt;","1","1"),
("290","&lt;p&gt;. A car moving with an initial velocity of 25 m/s north has a constant acceleration of&amp;nbsp;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;&lt;p&gt;south. After 6 seconds its velocity will be:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;7 m/s north&lt;/p&gt;","&lt;p&gt;7 m/s south&lt;/p&gt;","&lt;p&gt;43 m/s north&lt;/p&gt;","&lt;p&gt;20 m/s north&lt;/p&gt;","1","1"),
("291","&lt;p&gt;An object with an initial velocity of 12 meter per second &amp;nbsp;west experiences a constant acceleration of 4 meter per second square&amp;nbsp;west for 3 seconds. During this time the object travels a distance of:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;12 m&lt;/p&gt;","&lt;p&gt;24 m&lt;/p&gt;","&lt;p&gt;36 m&lt;/p&gt;","&lt;p&gt;54 m&lt;/p&gt;","4","1"),
("292","&lt;p&gt;&amp;nbsp;How far does a car travel in 6s if its initial velocity is 2 m/s and its acceleration is &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;msup&gt;&lt;mi&gt;s&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&amp;nbsp;in the forward direction?&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;12 m&lt;/p&gt;","&lt;p&gt;14 m&lt;/p&gt;","&lt;p&gt;24 m&lt;/p&gt;","&lt;p&gt;48 m&lt;/p&gt;","4","1"),
("293","&lt;p&gt;At a stop light, a truck traveling at 15 m/s passes a car as it starts from rest. The truck travels at constant velocity and the car accelerates at 3 meter per square second . How much time does the car take to catch up to the truck?&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;5 s&lt;/p&gt;","&lt;p&gt;10 s&lt;/p&gt;","&lt;p&gt;15 s&lt;/p&gt;","&lt;p&gt;20 s&lt;/p&gt;","1","1"),
("294","&lt;p&gt;. A baseball is thrown vertically into the air. The acceleration of the ball at its highest point is:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;zero&lt;/p&gt;","&lt;p&gt;g, down&lt;/p&gt;","&lt;p&gt;g, up&lt;/p&gt;","&lt;p&gt;2g, down&lt;/p&gt;","2","1"),
("295","&lt;p&gt;An object is thrown straight up from ground level with a speed of 50 m/s. If g = 10 meter per second square&amp;nbsp;its&lt;/p&gt;&lt;p&gt;distance above ground level 1.0 s later is:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;40 m&lt;/p&gt;","&lt;p&gt;45 m&lt;/p&gt;","&lt;p&gt;50 m&lt;/p&gt;","&lt;p&gt;55 m&lt;/p&gt;","2","1"),
("296","&lt;p&gt;An object is thrown straight up from ground level with a speed of 50 m/s. If g = 10 meter per second square&amp;nbsp;its&lt;/p&gt;&lt;p&gt;distance above ground level 6.0 s later is:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;0.00 m&lt;/p&gt;","&lt;p&gt;270 m&lt;/p&gt;","&lt;p&gt;330 m&lt;/p&gt;","&lt;p&gt;None of these&lt;/p&gt;","4","1"),
("297","&lt;p&gt;An object is released from rest. How far does it fall during the second of its fall?&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;4.9m&lt;/p&gt;","&lt;p&gt;9.8m&lt;/p&gt;","&lt;p&gt;15m&lt;/p&gt;","&lt;p&gt;20m&lt;/p&gt;","1","1"),
("298","&lt;p&gt;An object is released from rest. How far does it fall during the second of its fall?&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;4.9m&lt;/p&gt;","&lt;p&gt;9.8m&lt;/p&gt;","&lt;p&gt;15m&lt;/p&gt;","&lt;p&gt;20m&lt;/p&gt;","1","1"),
("299","&lt;p&gt;&amp;nbsp;A heavy ball falls freely, starting from rest. Between the third and fourth second of time it&lt;/p&gt;&lt;p&gt;travels a distance of:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;4.9 m&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;","&lt;p&gt;9.8 m&lt;/p&gt;","&lt;p&gt;29.4 m&lt;/p&gt;","&lt;p&gt;34.3 m&lt;/p&gt;","4","1"),
