("301","&lt;p&gt;An object is thrown vertically upward at 35 m/s. Taking g = 10 meter per second square , the velocity of the&lt;/p&gt;&lt;p&gt;object 5 s later is:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;7.0 m/s up&lt;/p&gt;","&lt;p&gt;15 m/s down&lt;/p&gt;","&lt;p&gt;15 m/s up&lt;/p&gt;","&lt;p&gt;85 m/s down&lt;/p&gt;","4","1"),
