("303","&lt;p&gt;&amp;nbsp;As a rocket is accelerating vertically upward at 9.8 meter per second square&amp;nbsp;near Earth&amp;rsquo;s surface, it releases a&lt;/p&gt;&lt;p&gt;projectile. Immediately after release the acceleration (in meter per second square) of the projectile is:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;9.8 down&lt;/p&gt;","&lt;p&gt;19.6 down&lt;/p&gt;","&lt;p&gt;9.8 up&lt;/p&gt;","&lt;p&gt;19.6 up&lt;/p&gt;","1","1"),
("304","&lt;p&gt;A constant-volume gas thermometer is used to measure the temperature of an object. When the thermometer is in contact with water at its triple point (273.16 K) the pressure in the thermometer is &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;8&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;500&lt;/mn&gt;&lt;mo&gt;&amp;#215;&lt;/mo&gt;&lt;msup&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;/msup&gt;&lt;mi&gt;P&lt;/mi&gt;&lt;mi&gt;a&lt;/mi&gt;&lt;/math&gt;&amp;nbsp;When it is in contact with the object the pressure is &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;9&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;650&lt;/mn&gt;&lt;mo&gt;&amp;#215;&lt;/mo&gt;&lt;msup&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;/msup&gt;&lt;mi&gt;P&lt;/mi&gt;&lt;mi&gt;a&lt;/mi&gt;&lt;/math&gt;.&amp;nbsp;The temperature of the object is:&lt;/p&gt;","1","","2","&lt;p&gt;310K&lt;/p&gt;","&lt;p&gt;241K&lt;/p&gt;","&lt;p&gt;37K&lt;/p&gt;","&lt;p&gt;314K&lt;/p&gt;","1","1"),
("305","&lt;p&gt;A constant-volume gas thermometer is used to measure the temperature of an object. When the thermometer is in contact with water at its triple point (273.16 K) the pressure in the thermometer is &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;8&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;500&lt;/mn&gt;&lt;mo&gt;&amp;#215;&lt;/mo&gt;&lt;msup&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;/msup&gt;&lt;mi&gt;P&lt;/mi&gt;&lt;mi&gt;a&lt;/mi&gt;&lt;/math&gt;&amp;nbsp;When it is in contact with the object the pressure is &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;9&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;650&lt;/mn&gt;&lt;mo&gt;&amp;#215;&lt;/mo&gt;&lt;msup&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mn&gt;4&lt;/mn&gt;&lt;/msup&gt;&lt;mi&gt;P&lt;/mi&gt;&lt;mi&gt;a&lt;/mi&gt;&lt;/math&gt;.&amp;nbsp;The temperature of the object is:&lt;/p&gt;","1","","2","&lt;p&gt;310K&lt;/p&gt;","&lt;p&gt;241K&lt;/p&gt;","&lt;p&gt;37K&lt;/p&gt;","&lt;p&gt;314K&lt;/p&gt;","1","1"),
("306","&lt;p&gt;The coefficient of linear expansion of steel is &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;11&lt;/mn&gt;&lt;mo&gt;&amp;#215;&lt;/mo&gt;&lt;msup&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mrow&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;6&lt;/mn&gt;&lt;/mrow&gt;&lt;/msup&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mi&gt;p&lt;/mi&gt;&lt;mi&gt;e&lt;/mi&gt;&lt;mi&gt;r&lt;/mi&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;.&amp;nbsp;A steel ball has a volume of exactly&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;100&lt;/mn&gt;&lt;mi&gt;c&lt;/mi&gt;&lt;msup&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&amp;nbsp;at&amp;nbsp;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;.&amp;nbsp;When heated to &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;100&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&amp;nbsp;its volume becomes:&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;100&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;33&lt;/mn&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mi&gt;c&lt;/mi&gt;&lt;msup&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;100&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;0011&lt;/mn&gt;&lt;mi&gt;c&lt;/mi&gt;&lt;msup&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;100&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;0033&lt;/mn&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mi&gt;c&lt;/mi&gt;&lt;msup&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&