("307","&lt;p&gt;The specific heat of lead is&amp;nbsp;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;mo&gt;.&lt;/mo&gt;&lt;mn&gt;030&lt;/mn&gt;&lt;mi&gt;c&lt;/mi&gt;&lt;mi&gt;a&lt;/mi&gt;&lt;mi&gt;l&lt;/mi&gt;&lt;mo&gt;/&lt;/mo&gt;&lt;mi&gt;g&lt;/mi&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&amp;nbsp;300g&amp;nbsp;of lead shot at 100 degree celcius&amp;nbsp;is mixed with 100 g of water at &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;70&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&amp;nbsp;in an insulated container. The final temperature of the mixture is:&lt;/p&gt;","1","","2","&lt;p&gt;100&amp;nbsp;degree celcius&amp;nbsp;&lt;/p&gt;","&lt;p&gt;&amp;nbsp;85.5degree celcius&amp;nbsp;&lt;/p&gt;","&lt;p&gt;72.5 degree celcius&amp;nbsp;&lt;/p&gt;","&lt;p&gt;74.5 degree celcius&amp;nbsp;&lt;/p&gt;","3","1"),
("308","&lt;p&gt;The heat capacity of object B is twice that of object A. Initially A is at 300K and B is at 450 K.They are placed in thermal contact and the combination is isolated. The final temperature of both objects is:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;200K&lt;/p&gt;","&lt;p&gt;300K&lt;/p&gt;","&lt;p&gt;400K&lt;/p&gt;","&lt;p&gt;450K&lt;/p&gt;","3","1"),
("309","&lt;p&gt;The coefficient of linear expansion of iron is 0.000011 per K. An iron rod is 10 m long at &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;27&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;.&amp;nbsp;The length of the rod will be decreased by 1.1 mm when the temperature of the rod changes to&lt;/p&gt;","1","","2","&lt;p&gt;0 degree celcius&lt;/p&gt;","&lt;p&gt;10&amp;nbsp;degree celcius&lt;/p&gt;","&lt;p&gt;17 degree celcius&lt;/p&gt;","&lt;p&gt;20 degree celcius&lt;/p&gt;","3","1"),
("310","&lt;p&gt;A temperature difference of &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;25&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&amp;nbsp;is equivalent to a temperature difference of&amp;nbsp;is equivalent to a temperature difference of&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;25&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;45&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;67&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;77&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","2","1"),
("311","&lt;p&gt;If the temperature of a patient is &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;40&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;, his temperature on the Fahrenheit scale will be&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;72&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;96&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;100&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;104&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","4","1"),
("312","&lt;p&gt;The correct value of &amp;nbsp;0 degree celcius&amp;nbsp;on the Kelvin scale is&lt;/p&gt;","1","","2","&lt;p&gt;273.15 K&lt;/p&gt;","&lt;p&gt;272.85 K&lt;/p&gt;","&lt;p&gt;273 K&lt;/p&gt;","&lt;p&gt;273.2 K&lt;/p&gt;","1","1"),
("313","&lt;p&gt;The change in temperature of a body is &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;50&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;. The change on the Kelvin scale is&lt;/p&gt;","1","","2","&lt;p&gt;50 K&lt;/p&gt;","&lt;p&gt;323 K&lt;/p&gt;","&lt;p&gt;70 K&lt;/p&gt;","&lt;p&gt;30 K&lt;/p&gt;","2","1"),
("314","&lt;p&gt;Recently the phenomenon of superconductivity has been observed at 95 K. This temperature is nearly equal to&lt;/p&gt;&lt;p&gt;&lt;b&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;288&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;146&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;F&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;368&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mo&gt;+&lt;/mo&gt;&lt;mn&gt;178&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","1","1"),
("315","&lt;p&gt;A steel metre scale is to be ruled so that millimetre intervals are accurate within about &lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;5&lt;/mn&gt;&lt;mo&gt;&amp;#215;&lt;/mo&gt;&lt;msup&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mrow&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;5&lt;/mn&gt;&lt;/mrow&gt;&lt;/msup&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;mi&gt;m&lt;/mi&gt;&lt;/math&gt;&amp;nbsp;at a certain temperature. The maximum temperature variation allowable during the ruling is: (Coefficient of linear expansion of steel =&amp;nbsp;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mo&gt;&amp;#215;&lt;/mo&gt;&lt;msup&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mrow&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;6&lt;/mn&gt;&lt;/mrow&gt;&lt;/msup&gt;&lt;msup&gt;&lt;mi&gt;K&lt;/mi&gt;&lt;mrow&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/mrow&gt;&lt;/msup&gt;&lt;/math&gt;)&lt;/p&gt;","1","","2","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;5&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;7&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mo&gt;&amp;#176;&lt;/mo&gt;&lt;mi&gt;C&lt;/mi&gt;&lt;/math&gt;&lt;/p&gt;","2","1"),
("316","&lt;p&gt;A piece of rubber 10cm long stretches 6mm when a load of 100N is hung from it. What is the strain?&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;","1","","2","&lt;p&gt;60&lt;/p&gt;","&lt;p&gt;6&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;6&lt;/mn&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;&amp;#215;&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;msup&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mrow&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/mrow&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","&lt;p&gt;&lt;math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;&gt;&lt;mn&gt;6&lt;/mn&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;mo&gt;&amp;#215;&lt;/mo&gt;&lt;mo&gt;&amp;#160;&lt;/mo&gt;&lt;msup&gt;&lt;mn&gt;10&lt;/mn&gt;&lt;mrow&gt;&lt;mo&gt;-&lt;/mo&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/mrow&gt;&lt;/msup&gt;&lt;/math&gt;&lt;/p&gt;","3","1"),
